import React, { useContext } from 'react';
import fire from '../fire'
import { Redirect, Router, Link } from 'react-router-dom'
import { AuthContext } from "../helpers/auth";

const Nav = ({history}) => {

    const handleLogout = () => {
        fire.auth().signOut();
    };

    const goToDatasets = () => {
        return <Redirect to="/Datasets" />; 
    }

    return (
        <Router>
            <div>
                <nav>
                <ul>
                    <li>
                    <button onClick={goToDatasets}>Datasets</button>
                    </li>
                </ul>
                <button onClick={handleLogout}>Sign out</button>
                </nav>
            </div>
        </Router>
    )

}

export default Nav
